button.onclick:
//$debug
var activiteCustom = returnEmpty(meibo.getFieldValues("activiteCustom"));
  var centreInteretCustom = returnEmpty(meibo.getFieldValues("centreInteretCustom"));
  var cvCustom = returnEmpty(meibo.getFieldValues("cvCustom"));
  var motsCleCustom = returnEmpty(meibo.getFieldValues("motsCleCustom"));
  /*Mise à jours dans l'AD*/
  var parameters = getProvisioningParameters_General();
  var parametersMail = getProvisioningParameters_Mails();
  var parametersDroit = getProvisioningParameters_Droit();


  var dnPers = meibo.getCurrentDn(); //-- récupération du DN courant
  var entry = new Entry();
  //mise en forme des attributs de la personne
  var newActivite = changeNameAttribute("activites",activiteCustom);
  var newCv = changeNameAttribute("cv",cvCustom);
  var newCentreInteret = changeNameAttribute("centreInteret",centreInteretCustom);
  var newMotsCle = changeNameAttribute("motsCle",motsCleCustom);

  entry.updateAttribute(newActivite);
  entry.updateAttribute(newCv);
  entry.updateAttribute(newCentreInteret);
  entry.updateAttribute(newMotsCle);

  var test = meibo.updateEntry("People",dnPers,entry);//-- Mise à jour dans l'AD des champs personnelle de la personne de la personne
  if ( test == false){
    var resourceError = meibo.getLastResourceError(); //-- récupération de la dernière erreur
    var messageError = resourceError.getMessage();//-- récupération du message d'erreur
    var grp_adminMeibo = parametersDroit.get("BCOM_PROFIL_AdminMeibo"); 
    var sendMailAdminMeibo = getAdressMailByRole(grp_adminMeibo);
    //plugin de mail d'erreur
    parametersMail.add("messageError",messageError+"</br></br>");
    parametersMail.add("sendMailAdminMeibo",sendMailAdminMeibo);
    parametersMail.add("action","Modification via le trombinoscope, saisie numéro de badge");
    meibo.executePlugin("Notification_ERREUR_PROVISIONING",parametersMail);
  }
  else
    meibo.showField("messageOk",true);
  }
  /*redirection vers une vue avec message de réussite*/

  meibo.setActiveTab(1);

//$debug
/**/
/* Script onClick du bouton Valider du formulaire de modification numéro badge */
/**/
/**/
/* Script modifié par akerva le 22/05
/**/
/* erreur*/
meibo.showField("messageOk",false);
var parameters = getProvisioningParameters_General();
var parametersMail = getProvisioningParameters_Mails();
var parametersDroit = getProvisioningParameters_Droit();

var error = returnEmpty(meibo.getField("errorPhoto").getValue());

if ( error == "FALSE" ){
  /* numéro de badge*/
  var srcFichier = returnEmpty(meibo.getField("srcFichier"));

  var fileEntrant = new File(srcFichier.getValue());
  fileEntrant.open("r");
  var taille = fileEntrant.getLength();
  if ( taille < 102400 ){
    var photo = fileEntrant.readBytes(999999999);
    fileEntrant.close();

    var cn = meibo.getFieldValue("cn");
    cn = cn.replace(" ","");
    var folder = parameters.get("BCOM_FOLDER_PHOTO_ENREGISTREMENT");
    var fileSortant = new File(folder+cn+".jpg");
    fileSortant.open("w");
    fileSortant.write(photo);
    fileSortant.close();


    /*Mise à jours dans l'AD*/



    var dnPers = meibo.getCurrentDn(); //-- récupération du DN courant
    var entry = new Entry();

    entry.thumbnailPhoto=photo;

    var test = meibo.updateEntry("People",dnPers,entry);//-- Mise à jours dans l'AD du numéro de badge de la personne
    if ( test == false){
      var resourceError = meibo.getLastResourceError(); //-- récupération de la dernière erreur
      var messageError = resourceError.getMessage();//-- récupération du message d'erreur
      var grp_adminMeibo = parametersDroit.get("BCOM_PROFIL_AdminMeibo"); 
      var sendMailAdminMeibo = getAdressMailByRole(grp_adminMeibo);
      //plugin de mail d'erreur
      parametersMail.add("messageError",messageError+"</br></br>");
      parametersMail.add("sendMailAdminMeibo",sendMailAdminMeibo);
      parametersMail.add("action","Modification via ma fiche, changement de photo");
      meibo.executePlugin("Notification_ERREUR_PROVISIONING",parametersMail);
    }




    meibo.setGlobalVar("BCOM_PROVENANCE_MA_FICHE","1");
    meibo.setGlobalVar("BCOM_ACTIVITES_MA_FICHE",returnEmpty(meibo.getFieldValues("activiteCustom")));
    meibo.setGlobalVar("BCOM_MOTSCLE_MA_FICHE",returnEmpty(meibo.getFieldValues("motsCleCustom")));
    meibo.setGlobalVar("BCOM_CV_MA_FICHE",returnEmpty(meibo.getFieldValues("cvCustom")));
    meibo.setGlobalVar("BCOM_CENTRE_INTERET_MA_FICHE",returnEmpty(meibo.getFieldValues("centreInteretCustom")));
    /*redirection vers une vue avec message de réussite*/
    meibo.switchToResourceView("People",dnPers,"Ma_Fiche_PERSONNE");
  }
  else{
    meibo.showField("avertissementPhoto2",true);
    meibo.showField("avertissementPhoto",false);
    meibo.getField("srcFichier").setStyles("champFormulaireObligatoire");
    meibo.setActiveTab(1); 
  }
}
else{
  meibo.setActiveTab(1);
}

button.prescript:
/**/
/* Script avant action du bouton Modification numéro badge */
/**/
/**/
/* Script modifié par akerva le 22/05
/**/

/*Verfication champs obligatoire*/
var srcFichier = returnEmpty(meibo.getField("srcFichier").getValue());
meibo.showField("avertissementPhoto2",false);
if ( srcFichier == "" ){
   meibo.showField("avertissementPhoto",true);
   meibo.setFieldValue("errorPhoto","TRUE");
   meibo.getField("srcFichier").setStyles("champFormulaireObligatoire");
}
else{
   meibo.showField("avertissementPhoto",false);
   meibo.setFieldValue("errorPhoto","FALSE");
   meibo.getField("srcFichier").setStyles("");
}
